  false,\n\t\"url\": null,\n\t\"notes\": \"This Narrative Report for Malheur National
  Wildlife Refuge covers January through April of 1956. The report begins with general
  information about the refugeu2019s weather and water conditions for the year.  Wildlife
  is discussed in the following section.  Animals of interest include migratory birds,
  upland game birds, big game animals, fur animals, predators, rodents, hawks, eagles,
  and fish.  Refuge maintenance and development activities are covered, including
  physical developments and plantings. Economic use of the refuge is also discussed;
  grazing is the primary use.  A progress report on field investigations and research
  is provided.  Public relations is covered; topics include recreational use of the
  refuge and visitors.  Additionally, items of interest and pictures are provided.\",\n\t\"license_title\":
